import React from 'react'

function Project(props) {
  return (
    <div className="Project">
      <div className="Project-overview">
        <img src={ props.picture } alt={ props.placeholder } ></img>
        <p>Star Wars coding kit at Kano Computing</p>
      </div>
      <div className="Project-detail">
        <p>ask me how I created a lightsaber with <span>pixi.js</span> and <span>Polymer.js</span></p>
      </div>
    </div>
  );
}

export default Project;
